import React from 'react';
import TodoItem from './TodoItem';
import userData from "./userData"

const styles = {
    backgroundColor: '#AFEEEE'
}

function App() {
    userData.map(user => {
        return <TodoItem input={user.input} />
    })
    return(
        <div className='wrapper'>
            <h2>Todo List:</h2> 
            <ol style={styles}>
                {userComponents}
            </ol>
        </div>
    )
};

export default App;
